import React from 'react'
import {Link} from 'react-router-dom'
import { StyledButton, StyledLogInButton } from '../Style/StyledButton'

export default function Button({label, path, del, out, to, create, login}) {
    return (
        <>
            {path && 
            <StyledLogInButton>
                <Link to={path}>
                    {label}
                </Link>
            </StyledLogInButton>
            }
            
            {del && 
            <StyledButton onClick={del}>
                    {label}
            </StyledButton>
            }

            {out && 
            <StyledButton logOut={true}>
                <Link to={to}>
                    {label}
                </Link>
            </StyledButton>
            }
            {create && 
                <Link to={to}>
                    <StyledButton create={true}>
                            {label}
                    </StyledButton>
                </Link>
            }

            
        </>
    )
}
